var $bm_rt;
var offset, t;
var v = effect('Evolution_(%)_In')(1);
var delay = effect('Delay_In')(1);
var reverse = effect('Reverse_In')(1);
if (reverse == true) {
    offset = $bm_mul($bm_mul($bm_sub(textTotal, textIndex), thisComp.frameDuration), delay);
} else {
    offset = $bm_mul($bm_mul($bm_sub(textIndex, 1), thisComp.frameDuration), delay);
}
t = $bm_sub(time, offset);
$bm_rt = v.valueAtTime(t);

p.x:
var $bm_rt;
var textFx;
try {
    $bm_rt = textFx = effect('Position_In');
    if (textFx.active) {
        $bm_rt = textFx(1);
    } else {
        $bm_rt = value;
    }
} catch (err) {
    $bm_rt = value;
}

